INSERT INTO `cms` VALUES (1,'Data Storage & Privacy Policy','data-storage-privacy-policy','<p><strong>Data Storage &amp; Privacy Policy</strong></p>\r\n\r\n<p>Language:&nbsp;&nbsp; English<br />\r\nLAST UPDATED: April 01, 2019</p>\r\n\r\n<p><em>Disclaimer: WITSYNC shall be bound by this Data Management and Privacy Policy under the provisions of Information Technology Act (No. 21 of 2000), Information Technology (Reasonable Security Practices and Procedures and Sensitive Personal Data or Information) Rules (Privacy Rules 2011) and such other laws as may be applicable.</em></p>\r\n\r\n<p>This Privacy Policy explains how we collect your Personal Data (defined below) on the website including online software modules of WITSYNC and its service providers that post or link directly to this Privacy Policy (collectively, the &ldquo;Website&rdquo;) and through offline means, how we protect such data, and the choices you have concerning our use of such data. Please read this Privacy Policy carefully. WITSYNC may from time to time update this Privacy Policy. Any changes to this Privacy Policy will become effective when we post or link to the revised Privacy Policy on the website. Please review the &quot;<em>LAST UPDATED</em>&quot; legend at the top of this page to determine when this Privacy Policy was most recently revised.</p>\r\n\r\n<p>For the purposes of this Privacy Policy, &ldquo;WITSYNC&rdquo;, &quot;we&quot;, &quot;us&quot;, and &quot;our&quot; means WITSYNC Soft Solutions Private Limited.</p>\r\n\r\n<p>You do not have to provide us with any Personal Data to visit the website. However, if you choose to withhold requested information, you may not be able to visit all sections or use all features of the website.</p>\r\n\r\n<p>This Privacy Policy shall apply to any WITSYNC mobile application and other forms of WITSYNC online activity that reference this Privacy Policy. In such instances, the term &ldquo;Website&rdquo; shall include the applicable mobile application or other WITSYNC online activity whenever that term is used herein. In connection with your use of any WITSYNC mobile application, your Personal Data (and Other Data, as described below) may also be collected and used by your mobile device manufacturer, the mobile application store from which you obtained the WITSYNC mobile application, your telecommunication provider, or other third parties involved in the delivery of the application or data to your mobile device, and such practices shall be subject to the privacy policy of the applicable third party. WITSYNC is not responsible for any third party&rsquo;s privacy practices.</p>\r\n\r\n<p><strong>Introduction</strong></p>\r\n\r\n<p>The website and other online software modules are owned and operated by WITSYNC. We are strongly committed in protecting your privacy and has taken all necessary and reasonable measures to protect your personal information and to handle the same.</p>\r\n\r\n<p><strong>Types of Data Collected</strong></p>\r\n\r\n<p>We gather Personal Data and Other Data (as described below).</p>\r\n\r\n<p><strong>Collection of Personal Data</strong></p>\r\n\r\n<p>Personal data is information that identifies you or can be used to identify or contact you,&nbsp;<em>e.g.</em>, your name, email address, address, or phone number (&quot;Personal Data&quot;).</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;WITSYNC requests Personal Data from you when you register on the Website. The registration process requests that you provide your name, email address, date of birth, and other contact details, and agree to the User Agreement presented at the time of registration.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;WITSYNC may receive Personal Data from social media platforms. For example, if you elect to use your social media credentials to log-in to your Website account, certain Personal Data from your social media account will be shared with us, which may include Personal Data that is part of your profile.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;WITSYNC may collect Personal Data voluntarily provided by you, including in emails to the Website, online forms, order and registration forms, surveys, promotion participation, phone calls with WITSYNC customer service and through other means.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;We may use third-party payment services (each, a &quot;Payment Service&quot;) to collect payments made through the Website. If you wish to make a payment through the Website, you may be directed to a webpage that is hosted by the Payment Service (or the Payment Service&#39;s service providers) and not by WITSYNC. Any Personal Data that you provide through a Payment Service page will be collected by Payment Service and not by WITSYNC, and shall be subject to Payment Service&#39;s privacy policy, rather than this Privacy Policy. WITSYNC has no control over, and shall not be held responsible for, Payment Service&#39;s use of information collected through the Payment Service Page.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;WITSYNC collects information through various other means, including participation at conferences and events, individual introductions, from employers that enroll their employees in our services and from selected third party business partners. From time to time, we may also acquire from third parties&rsquo; certain lists containing the names and contact information of individuals who may be interested in our products and services.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>During the time of your consent to operate the website/software, we will ask you for your personal details like the name of the Company, address of the Company, Indian Goods &amp; Service Tax Number (if applicable), registered address, E-mail id and some information provided by you may be sensitive information but such information shall be necessary to grant access only to legally valid companies and to help us to get your valid identification and to endure you with the best services.</p>\r\n	</li>\r\n	<li>\r\n	<p>The Companies are also required to add the details of the leases bifurcated into leases of buildings, lands, plant and machinery etc. WITSYNC also provides you with an option to upload any further documents relevant to such leases. The lease information so provided by you shall contain terms of lease, execution of lease, period of lease, lease payments and any other mathematical documentation required as per the protocols of the lease for the estimate valuation of the lease.</p>\r\n	</li>\r\n	<li>\r\n	<p>The user shall themselves enter the required details while using the website. Unless the required details are provided at the time of registration or thereafter as may be required by WITSYNC for account activation, the user shall not be able to access the website or avail any services provided through the website by WITSYNC. The user can change their given information at any time by accessing their online website account.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Use of Data Collected</strong></p>\r\n\r\n<p><em>We may use Personal Data for the following purposes:</em></p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Fulfillment of Requests. WITSYNC may use Personal Data about you to deliver products and services, and provide you with information about products and services you&rsquo;ve ordered.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Other Communications. From time to time, we may use Personal Data about you to inform you of products, programs, services and promotions that we believe may be of interest to you. If your employer is a WITSYNC customer, we may also inform you of such products, programs, services and promotions using Personal Data about you that your employer provided to WITSYNC. If you would prefer that we not send electronic marketing messages to you, please see the &quot;Your Choices&quot; section below.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Promotions. We may operate sweepstakes, contests and similar promotions (collectively, &quot;Promotions&quot;). We typically ask you for certain Personal Data when you enter and, if applicable, win a Promotion. You should carefully review the rules of each Promotion in which you participate, as they may contain additional important information about our use of Personal Data about you. To the extent that the terms and conditions of such rules concerning the treatment of Personal Data about you conflict with this Privacy Policy, the terms and conditions of such rules shall control.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Internal Business Purposes. We may also use Personal Data about you for our internal business purposes, such as data analysis, editorial and feedback purposes, providing customer support, customizing and improving the content and layout of the Website, completing business transactions, development of marketing and promotion plans and materials, statistical analysis of user behavior, product development, administering individual accounts, and meeting government regulatory requirements such as sales tax collection, audits, etc.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Administrative Communications. In addition, WITSYNC reserves the right to use Personal Data to send to you important information regarding the Website, your account status, changes to the User Agreement, this Privacy Policy, or any other policies, agreements or transactions relevant to your use of the Website. Because this information may be important to your use of the Website, you may not opt-out of receiving such communications.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Lessee Leasing Management Software: The details entered by you shall be used for processing to get the desired output reports duly compliant with the New Accounting Standard on Leases. Any information given to us from your end shall only be used to fulfil your requirement. Your sensitive information will not be redistributed to anyone. We use methods which are best and widely accepted, to protect your information. We comply with the applicable laws and review our security procedures carefully. Our team is trained to safeguard your details and financial information. We have strict security standards so as to prevent unauthorized use of your details and information by anyone. We use different methods like Strong Data Encryption to secure your data.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p><strong>Collection and Use of Other Data</strong></p>\r\n\r\n<p><em>We and our service providers may also collect and use the following types of data, referred to in this Privacy Policy as &ldquo;Other Data&rdquo;:</em></p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Monitoring Data. WITSYNC and its service providers may collect and/or track other information such as demographic information, domain names, computer type, browser types, screen resolution, and other statistical data involving the use of the Website (&quot;Monitoring Data&quot;). We use Monitoring Data to help us understand who uses the Website and to improve and market it, as well as our other web Websites and services. Unless combined with Personal Data, Monitoring Data does not personally identify you or any other user, and we may use it for any purpose.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Aggregated Data. Additionally, we may aggregate Personal Data in a manner such that the end-product does not personally identify you or any other user of the Website, for example, by using information to calculate the percentage of our users who have a particular telephone area code. Such aggregate information may also be used for any purpose.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Cookies. To enhance the Internet experience on the Website, WITSYNC and our service providers may use &lsquo;cookies&rsquo; on the Website. Cookies are data that a web server transfers to an individual&#39;s computer for recordkeeping and other purposes. We use cookies and other technologies to facilitate users&#39; ongoing access to and use of our Website. If you do not want information collected through the use of cookies, there is a simple procedure in most browsers that allows you to automatically decline cookies, or to be given the choice of declining or accepting the transfer of a particular cookie, or cookies from a particular web Website, to your computer. If cookies are disabled, however, all features of the Website may not operate as intended. Information about the procedure you are required to follow in order to disable cookies can be found on your Internet browser provider&rsquo;s web Website. We expect our service providers to honor any decision by you to block or disable cookies in connection with the Website.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;Tools. We and our service providers may also use various common Internet tools such as &#39;pixel tags,&#39; &lsquo;action tags,&rsquo; &lsquo;web beacons,&rsquo; &lsquo;.gif tags,&rsquo; &#39;JavaScript&#39; or similar technologies (together, &quot;Tools&quot;) in connection with Website pages and email messages in certain formats to among other things, track the actions of Website users and email recipients, to determine the success of marketing campaigns and to compile statistics about Website usage and response rates. Tools allow us to count users who have visited certain pages of the Website, to deliver branded services, and to help determine the effectiveness of promotional or advertising campaigns. When used in email messages in certain formats, Tools can tell the sender whether and when the email has been opened.<br />\r\n<br />\r\nWITSYNC uses cookies and Tool technologies to understand how the Website is used and to customize and enhance the Internet experience of individual users. When you revisit the Website, WITSYNC may recognize you by a Tool and customize your experience. For example, once you have completed the registration process, a cookie and/or Tool will be used to avoid having you register again. We believe cookies and Tool technologies add value to the user experience.</p>\r\n\r\n<p>&bull; Google Analytics. We use Google Analytics, which uses cookies and other, similar technologies to collect and analyze information about Website use and report on activities and trends. The service may also collect information regarding the use of other Websites, apps and online resources. You can learn about Google&rsquo;s practices by going to&nbsp;<a href=\"http://www.google.com/policies/privacy/partners/\">www.google.com/policies/privacy/partners/</a>, and opt out of them by downloading the Google Analytics opt-out browser add-on, available at&nbsp;<a href=\"https://tools.google.com/dlpage/gaoptout\">https://tools.google.com/dlpage/gaoptout</a>.</p>\r\n\r\n<p>&bull; Verification. We may use third-party services to verify that you are a human user. Any information collected as part of such verification is subject to the privacy policy of the third-party service provider.</p>\r\n\r\n<p>&bull; IP Addresses. When you visit, and interact with the Website, we and our third-party service providers may collect Internet Protocol (IP) addresses. Your IP address is a number that is automatically assigned to the computer that you are using by your Internet Service Provider (ISP). This number is identified and logged automatically in our server log files whenever you visit the Website, along with the time(s) of your visit(s) and the page(s) that you visited. We use IP addresses to understand how the Website is used by our users and to improve the Website. Where required by applicable law, IP addresses will be treated as Personal Data.</p>\r\n\r\n<p><strong>Data storage</strong></p>\r\n\r\n<p>The stored data under certain sections of the Website/Software shall be encrypted and backed-up on a daily basis. Such backup data shall be retained and maintained by WITSYNC as per provisions of this policy. At any point, where the user wishes to withdraw the services of WITSYNC, the users shall unsubscribe from the software. The software will automatically eliminate these data provided by the user, within a time frame of 3 months. In the case of failure to pay the annual subscription fee, the data of the user shall be removed from the software within a time frame of Three (3) months.</p>\r\n\r\n<p><strong>Disclosure of Personal Data Collected</strong></p>\r\n\r\n<p>Disclosure of sensitive personal data or information by WITSYNC to any third party shall be done only after the prior written permission from the provider of such information, who has provided such information under lawful contract or otherwise, unless such disclosure has been agreed to in the contract between the WITSYNC and provider of information, or where the disclosure is necessary for compliance of a legal obligation. WITSYNC shall not publish any sensitive information of the provider of information without prior consent of the provider of information. However, the information shall be shared, without obtaining prior consent from provider of information, with Government agencies mandated under the law to obtain information including sensitive personal data or information for the purpose of verification of identity, or for prevention, detection, investigation including cyber incidents, prosecution, and punishment of offences. Furthermore, any sensitive personal data on Information shall be disclosed to any third party by an order under the law for the time being in force.</p>\r\n\r\n<p><strong>Your Choices</strong></p>\r\n\r\n<p>We give you choices regarding our use and disclosure of your Personal Data for marketing purposes.</p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;If you no longer want to receive marketing-related emails from us on a going-forward basis, you may stop receiving these marketing-related emails by sending an e-mail to&nbsp;<a href=\"mailto:info@witsync.co\">info@witsync.co</a></p>\r\n\r\n<p>&bull;&nbsp;&nbsp;&nbsp;&nbsp;If you would prefer that we do not share your Personal Data on a going-forward basis with our affiliates or with unaffiliated third parties for their marketing purposes, you may cease this sharing by sending an e-mail to&nbsp;<a href=\"mailto:info@witsync.co\">info@witsync.co</a></p>\r\n\r\n<p>We will try to comply with your request(s) as soon as reasonably practicable. Please note that if you exercise the second option as described above, we will not be able to remove your Personal Data from the databases of our affiliates or unaffiliated third parties with which we have already shared your Personal Data (<em>i.e.</em>, to which we have already provided your Personal Data as of the date that we implement your request). Further, please note that requesting us not to share your Personal Data with affiliates or unaffiliated third parties may result in you no longer receiving any marketing emails from WITSYNC. Please also note that if you choose not to receive marketing-related messages from us, we may still send you important administrative messages, and you cannot elect to stop receiving such administrative messages, unless you choose to stop receiving services from us.</p>\r\n\r\n<p>If we intend to use your Personal Data for a purpose that is incompatible with the purposes detailed in this Privacy Policy, or if we intend to disclose it to a type of third party not previously identified, we will notify you and offer you the opportunity to opt-out of such uses and/or disclosures.</p>\r\n\r\n<p>You may also indicate your choices regarding marketing-related emails by changing your preferences on your Website profile/account at any time, or contacting us via postal mail or telephone using the&nbsp;<em>&ldquo;Contact Information for WITSYNC&rdquo;</em>&nbsp;below.</p>\r\n\r\n<p><strong>How you can access, change or suppress your Personal Data</strong></p>\r\n\r\n<p>If you would like to review, correct, update, suppress, delete or otherwise limit our use of your Personal Data that has been previously provided to us, you may make a request by contacting us using the information provided in the&nbsp;<em>&ldquo;Contact Information for WITSYNC&rdquo;</em>&nbsp;below. For your protection, we may only implement requests with respect to the Personal Data associated with the particular email address that you use to send us your request, and we may need to verify your identity before implementing your request. We will try to comply with your request as soon as reasonably practicable and consistent with applicable law. Please note that we may need to retain certain information for recordkeeping purposes and/or to complete any transactions that you began prior to requesting the change or deletion.</p>\r\n\r\n<p><strong>Links</strong></p>\r\n\r\n<p>The Website may contain links to other Internet web Websites, including social media Websites. These linked Websites are not under WITSYNC control. We provide links only as a convenience, and WITSYNC does not endorse or control, and is not responsible for, the privacy practices or the content of these linked Websites. If you provide any Personal Data through any third-party web Website, your transaction will occur on that third party&#39;s web Website (not the Website) and the Personal Data you provide will be collected by, and controlled by the privacy policy of, that third party. We recommend that you familiarize yourself with the privacy policies and practices of any such third parties. PLEASE NOTE THAT THIS PRIVACY POLICY DOES NOT ADDRESS THE PRIVACY OR INFORMATION PRACTICES OF ANY THIRD PARTIES, INCLUDING, WITHOUT LIMITATION, AFFILIATED ENTITIES THAT DO NOT POST OR LINK DIRECTLY TO THIS PRIVACY POLICY.</p>\r\n\r\n<p>We at WITSYNC believe in providing our users with the best of experience, WITSYNC has taken a major step towards fulfilling the requirement of the users of WITSYNC, by hosting the software through the Host servers.</p>\r\n\r\n<p>WITSYNC is not liable for any misappropriation done by the Host Servers. The information and data provided to the Host servers will not come under the responsibility of WITSYNC. However, WITSYNC shall take all measures to ensure data is fully secured and protected by the provider of Host Servers and such Host Servers should be internationally approved to provide world&rsquo; s best Hosting Services.</p>\r\n\r\n<p><strong>Security Measures</strong></p>\r\n\r\n<p>WITSYNC has established reasonable organizational and technical measures to protect Personal Data within our organization from loss, misuse, or unauthorized access, disclosure, alteration or destruction. Please note that while WITSYNC has endeavored to create a secure and reliable Website for users, no Website is 100% secure. If you have reason to believe that your interaction with us is no longer secure (for example, if you feel that the security of any account you might have with us has been compromised), please notify us of the problem immediately by contacting us using the information provided below in&nbsp;<em>&quot;Contact Information for WITSYNC&quot;</em>&nbsp;(note that if you choose to notify us via physical mail, this will delay the time it takes for us to respond to the problem).</p>\r\n\r\n<p>We safeguard your privacy using known security standards and procedures and comply with applicable privacy laws. Our Website combines industry-approved physical, electronic and procedural safeguards to ensure that your information is well protected through its life cycle in our infrastructure. Personal Information is hashed or encrypted when it is stored in our infrastructure. Personal Information is decrypted, processed and immediately re-encrypted or discarded when no longer necessary.</p>\r\n\r\n<p><strong>Our Commitment to Personal Information Security</strong></p>\r\n\r\n<p>We recognize that your privacy is important to you, and therefore we endeavor to keep your Personal Information confidential. We will take all reasonable technical and organizational precautions to prevent the loss, misuse or alteration of your Personal Information. We assure you of our best effort to protect Personal Information, however, we do not represent, warrant, or guarantee that your personal information will be protected against unauthorized access, loss, misuse, or alterations, and do not accept any liability for the security of the personal information submitted to us nor for your or third parties use or misuse of personal information.</p>\r\n\r\n<p><strong>Data Integrity</strong></p>\r\n\r\n<p>WITSYNC will use Personal Data only in ways that are compatible with the purposes for which it was collected, authorized by this Privacy Policy, or authorized by you. WITSYNC will take reasonable steps to ensure that Personal Data is relevant to its intended use, and is accurate, complete, and current (as provided by you). WITSYNC depends on you to update or correct your Personal Data whenever necessary.</p>\r\n\r\n<p><strong>Retention Period</strong></p>\r\n\r\n<p>We will retain Personal Data about you for the period reasonably necessary to fulfill the purposes outlined in this Privacy Policy and consistent with retention periods required or permitted by law.</p>\r\n\r\n<p><strong>Cross Border Transfer of Personal Data</strong></p>\r\n\r\n<p>Your Personal Data may be stored and processed in any country where we have facilities or in which we engage service providers, and by using this Website or sharing Personal Data with us, you consent to the transfer of information to countries outside of your country of residence, including the United States, which may have different data protection rules than in your country.</p>\r\n\r\n<p><strong>Enforcement</strong></p>\r\n\r\n<p>WITSYNC periodically will review its compliance with this Privacy Policy. WITSYNC will also review and respond to any formal written complaints that we receive from you. Please contact us at the address listed below in&nbsp;<em>&ldquo;Contact Information for WITSYNC.&rdquo;</em></p>\r\n\r\n<p><strong>Use of this Website by Minors</strong></p>\r\n\r\n<p>This Website is not directed to individuals under the age of eighteen (18), and we request that these individuals do not provide Personal Data through this Website.</p>\r\n\r\n<p><strong>Sensitive Personal Data</strong></p>\r\n\r\n<p>We ask that you not send us, and you not disclose, any sensitive Personal Data (e.g., social security numbers, information related to racial or ethnic origin, political opinions, religion or other beliefs, health, criminal background or trade union membership) on or through this Website or otherwise to us.</p>\r\n\r\n<p><strong>Changes to the Data Storage &amp; Privacy Policy</strong></p>\r\n\r\n<p>Our privacy policy demonstrates our commitment towards protecting your financial information. By taking our services you agree to it that the content or services of our website may be changed at any time without prior notice and similarly our privacy policy too may change in future. By accessing to our website or software we shall consider that you agree to all policy changes made by WITSYNC.</p>\r\n\r\n<p><strong>Contact Information for WITSYNC</strong></p>\r\n\r\n<p>Questions or concerns regarding WITSYNC data protection practices should be addressed to:</p>\r\n\r\n<p>Legal Department<br />\r\nWITSYNC Soft Solutions Private Limited<br />\r\n40 B, LP Block, Maurya Enclave, Pitam Pura, Delhi, India<br />\r\nE-mail: <a href=\"mailto:Info@witsync.co\">Info@witsync.co</a></p>\r\n\r\n<p>If you choose to contact WITSYNC via e-mail about this Privacy Policy, please mark the subject heading of your e-mail &ldquo;Privacy Inquiry.&rdquo;</p>','Data Storage & Privacy Policy','Data Storage & Privacy Policy','Data Storage & Privacy Policy','1','2019-03-27 05:46:37','2019-03-27 05:47:46'),(2,'Disclaimer Policy','disclaimer-policy','<p>Language: English</p>\r\n\r\n<p>Last Updated: April 01, 2019</p>\r\n\r\n<p>COOKIES DISCLAIMER:</p>\r\n\r\n<p>We use cookies on this website to ensure that we give you the best experience on our website. We also use cookies to ensure you