nt with Laws etc., the Company makes no representations or warranties of any kind, express or implied, about the completeness, accuracy, reliability, suitability or availability with respect to the website or the information, products, services, or related graphics contained on the Website for any purpose. Any reliance you place on such information is therefore strictly at your own risk.</p>\r\n\r\n<p>In no event will we be liable for any loss or damage including without limitation, direct, indirect or consequential loss or damage, or any loss or damage whatsoever arising from loss of data or profits arising out of, or in connection with, the use of this Website.</p>\r\n\r\n<p>Through this Website you are able to link to other websites which are not under the control of the Company. Links to third party websites does not constitute an endorsement by the Company of the third parties or their products and services. The appearance on the website of advertisements and products or service information does not constitute endorsement by the Company and the Company has not investigated the claims made by the third party. We have no control over the nature, content and availability of those sites. The Company is not responsible for the content or the accuracy of the information in these websites. The inclusion of these links does not necessarily imply a recommendation or endorsement in the views expressed within them.</p>\r\n\r\n<p>Every effort is made to keep the website up and running smoothly. However, the Company takes no responsibility for, and will not be liable for, the website being temporarily unavailable due to technical issues beyond our control.</p>','Disclaimer Policy','Disclaimer Policy','Disclaimer Policy','1','2019-03-27 05:47:41','2019-03-27 05:47:42'),(3,'Data Protection Policy','data-protection-policy','<p><strong>GENERAL DATA PROTECTION REGULATION</strong></p>\r\n\r\n<p><em><strong>Disclaimer: </strong></em><em>General Data Protection Regulation is opted 