p><strong>Rights of EU users:</strong></p>\r\n\r\n<p>EU General Data Protection Regulation (GDPR) has provided the below rights to the EU residents:</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Right to information&nbsp;- including contact details to the DPO, the purposes for processing Personal Information and the rights of the individual.</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to access&nbsp;the Personal Information that are processed</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to erasure&nbsp;(&rdquo;Right to be forgotten&rdquo;)</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to rectification</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to restriction of processing</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to data portability&nbsp;of the Personal Information supplied to WITSYNC by the EU resident</p>\r\n	</li>\r\n	<li>\r\n	<p>Right to object&nbsp;(opt-out) to processing (unless WITSYNC otherwise has compelling legitimate grounds)</p>\r\n	</li>\r\n</ul>\r\n\r\n<p>EU residents can exercise these rights by raising a request directly at info@witsync.co or contact WITSYNC at the information provided in&nbsp;<strong>CONTACT WITSYNC</strong>&nbsp;section.<br />\r\n&nbsp;</p>','Data Protection Policy','Data Protection Policy','Data Protection Policy','1','2019-03-27 05:48:47','2019-03-27 05:48:49'),(4,'Intellectual Property Rights','intellectual-property-rights','<p>Language: English</p>\r\n\r\n<p>Last Updated: April 01, 2019</p>\r\n\r\n<p><a name=\"_GoBack\"></a> INTELLECTUAL PROPERTY RIGHTS</p>\r\n\r\n<p>The Website and its entire contents, features, and functionality (including but not limited to all information, software, text, displays, images, courseware, video, audio, the design, selection, and arrangement thereof), are owned by WITSYNC Soft Solutions Private Limited (the Company), its licensors, or other providers of such material and are protected by the copyright, trademark, patent and other intellectual property or proprietary rights laws of India.</p>\r\n\r\n<p>The Terms of Use permit you to use the Website 