INSERT INTO `email_templates` VALUES (1,'Verify Your Email Address','Verify Your Email Address','EMAIL_VERIFICATION','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title>:: Witsync ::</title>\r\n</head>\r\n\r\n<body>\r\n	<div style=\"max-width:650px; margin:0 auto; width:100%;\">\r\n    	<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\" style=\"border:#c0c0c0 solid 1px; font-family:Arial, Helvetica, sans-serif;\">\r\n        	<tr>\r\n            	<td style=\"background:#cbe0ea; border-bottom:#c0c0c0 solid 1px; padding:10px 20px;\"><a href=\"[[APP_LINK]]\" target=\"_blank\" style=\"line-height:0px;\"><img src=\"[[APP_LINK]]/images/emailer_logo.png\" alt=\"\" /></a></td>\r\n            </tr>\r\n            <tr>\r\n            	<td style=\"padding:20px; font-size: 16px; color: #999; line-height: 25px;\">\r\n                	<h2 style=\"font-size:20px; color:#00a3ef; text-align:center;\">Please Confirm Your Email Address</h2>\r\n                    <span style=\"padding-bottom:15px; display:inline-block;\">Hello [[USER_NAME]],</span><br/>\r\n                    <span style=\"padding-bottom:15px; display:inline-block;\">Thanks for registering your account with us. Its great to have you on board!</span><br/>\r\n                    <span style=\"padding-bottom:15px; display:inline-block;\">To complete the registration process, you need to verify your email address.  Please click on the below email address to verify your email address.</span><br/>\r\n                    <span style=\"padding-bottom:15px; display:inline-block;\"><a href=\"[[ACTION_URL]]\" style=\"color:#007bd5;\">Verify Email Address</a></span><br/>\r\n                    <span style=\"padding-bottom:15px; display:inline-block;\">If youre having trouble with the link abov